import React from 'react';
import CountriesList from "../companents/CountriesList";
import Navbar from "../companents/navbar";
import styled from "styled-components";


const Home = () => {
    return (
        <>
            <Navbar/>
            <hr/>
            <CountriesList/>
        </>
    );
};

const PlusIcon = styled.a`
  width: 55px;
  height: 55px;
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  background: ${prop => prop.theme.colors.main};
  position: fixed;
  bottom: 15px;
  right: 30px;
`;
export default Home;
